import { Fragment } from 'react';
import './App.css';
import Home from './screens/Home';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div>
        <Routes>
          <Route path='' element={<Home/>} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
